import './AboutUs.css';
import Headshot from './headshot-ceo.jpg';

export default function Leadership () {

    return (
        <div>
            <div className="leadership">
                <div id='title'> Leadership </div>
                <div id='small-text'> Meet the executive team</div>
                <div className="leadership-introduction">

                    {/* <div> */}
                    <img src={Headshot} className='intro-photo'/>
                    {/* </div> */}

                    <div className="intro-text">
                    Yiqi Ni, Founder & CEO 

                    Yiqi is the founder and CEO of Accretion LLC. 

                    Yiqi created Accretion after graduation in 2023 from MIT with a Ph.D. degree in physics. 

                    With a passion for experimentation, statistics and physics models, Yiqi created Accretion to lower barrier of entry to the housing market. 

                    By empowering every tools and data that were limited to few real estate professionals, Yiqi is dedicated to growing for more people to achieve financial freedom. 

                    You can connect directly with Yiqi through email yiqi.ni.x@gmail.com. 
                    </div>
                </div>

            </div>
        </div>
    )
}
